const mongoose = require("mongoose");
const Schema = mongoose.Schema;

const ServerSchema = new Schema({
  name: {
    type: String,
    required: true
  },
  image: {
    type: String,
    default:
      "data:image/png;base64,"
  },
  creator: {
    type: Schema.Types.ObjectId,
    ref: "user",
    required: true
  },
  admins: [
    {
      type: Schema.Types.ObjectId,
      ref: "user"
    }
  ],
  members: [
    {
      type: Schema.Types.ObjectId,
      ref: "user"
    }
  ],
  channels: [
    {
      type: Schema.Types.ObjectId,
      ref: "channel"
    }
  ],
  selectedChannel: {
    type: Schema.Types.ObjectId,
    ref: "channel"
  }
});

module.exports = Server = mongoose.model("server", ServerSchema);
